import React, { useEffect, useState } from 'react';
import axios from 'axios';

import './App.css';

function App() {
  const [starWars, setStartWars] = useState('');
  useEffect(() => {
    const fetch = async () => {
      const { data } = await axios.get('https://swapi.co/api/films/1/');
      console.log(data);
    };
    fetch();
  }, []);

  return (
    <div className='App'>
      <h1>Simple Fetch Data</h1>
    </div>
  );
}

export default App;
